import React, {Component} from 'react';
import {Navbar} from 'react-bootstrap';  
import './acevents.jpg'

class Nav extends Component{
    render(){
        return(
<Navbar bg="dark" variant="dark">
<Navbar.Brand href="#home">
  <img
    alt=""
    src="/acevents.jpg"
    width="30"
    height="30"
    className="d-inline-block align-top"
  />

</Navbar.Brand>
</Navbar>
        )
}
}
export default Nav;
